angular.module('app').controller('appController', ['$scope', 'viewService', '$http', appController]);

function appController($scope, viewService, $http) {
    var vm = this;
    vm.title = "Spadok - adminium";
    $http.get('/isloggedin').then(function () {
        vm.isLoggedIn = true;
        viewService.state = vm.state = 'projectManager';
    }, function () {
        viewService.state = vm.state = 'login';
    });
    $scope.$watch(function () {
        return viewService.state;
    }, function () {
        vm.state = viewService.state;
    });
}
'use strict';

(function () {
    angular.module('app').directive('spdaLoginForm', ['$http', 'viewService', loginForm]);

    function loginForm($http, viewService) {

        return {
            restrict: "E",
            templateUrl: "./admin/blocks/login-form/login-form.html",
            link: link
        };

        function link(scope) {
            scope.status = '';
            scope.queriing = false;
            scope.submit = function (form) {
                scope.status = 'Searching...';
                scope.queriing = true;
                $http.post('/login', {
                    name: scope.name,
                    password: scope.password
                }).then(function (response) {
                    scope.status = ' ' + response.status + ' ' + response.statusText + '. Welcome,  ' + response.data.name;
                    viewService.state = "projectManager";
                }, function (reason) {
                    if (reason.status === 401) {
                        scope.status = 'Sorry, but you are not supposed to be here. ' + reason.status + ' ' + reason.statusText + '.';
                    } else {
                        scope.status = 'Sorry, but my manuscripts got wet. Maybe, you\'ll find out what happened? ' + reason.status + ' ' + reason.statusText + '.';
                    }
                }).finally(function () {
                    scope.queriing = false;
                });
            };
        }
    }
})();
'use strict';

(function () {
    angular.module('app').directive('spdaNewProject', ['$http', 'viewService', '$interval', '$timeout', directive]);

    function directive($http, viewService, $interval, $timeout) {
        var s200 = "Congrats! Your operation was successfully completed! :)";
        var s401 = "Sorry, something was happened with your session. Please, reenter your credentials :(";
        var s500 = "Sorry, something was happened with server. Wait a few minutes or contact your administrator :(";
        var sOther = "Sorry, unhandled error occurred. Wait a few minutes or contact your administrator :(";

        return {
            restrict: "E",
            templateUrl: "./admin/blocks/new-project/new-project.html",
            scope: {
                init: "=",
                view: "="
            },
            controller: ['$scope', controller]
        };

        function controller($scope) {
            var vm = this;
            $scope.$watch(function () {
                return $scope.init;
            }, function (newVal) {
                if (newVal) {
                    $scope.name = newVal.name;
                    $scope.description = newVal.description;
                    $scope.people = newVal.people;
                    $scope.money = newVal.money;
                    $scope.date = new Date(newVal.date);
                    $scope.isPublished = newVal.isPublished;
                    $scope.isCompleted = newVal.isCompleted;
                } else {
                    $scope.name = $scope.description = $scope.people = $scope.money = $scope.date = $scope.isCompleted = $scope.isPublished = null;
                }
            }, true);

            $scope.submit = function (form, event) {
                $scope.isQueriing = true;
                if (event.target.getAttribute('form-type') === "new-project") {
                    add();
                } else if (event.target.getAttribute('form-type') === "edit-project") {
                    update();
                }
            };

            $scope.delete = function () {
                $http.delete('/adminium/removeproject/' + $scope.init._id).then(success, fail);
            };

            function add() {
                $http.post('/adminium/addproject', {
                    name: $scope.name,
                    description: $scope.description,
                    people: $scope.people,
                    money: $scope.money,
                    date: $scope.date,
                    isCompleted: $scope.isCompleted,
                    isPublished: $scope.isPublished
                }).then(success, fail);
            }

            function update() {
                $http.put('/adminium/updateproject', {
                    _id: $scope.init._id,
                    name: $scope.name,
                    description: $scope.description,
                    people: $scope.people,
                    money: $scope.money,
                    date: $scope.date,
                    isCompleted: $scope.isCompleted,
                    isPublished: $scope.isPublished
                }).then(success, fail);
            }

            function success(data) {
                $scope.statusText = s200;
                $scope.statusClassName = "label label-success";
                $scope.isQueriing = false;
                $scope.name = $scope.description = $scope.people = $scope.money = $scope.date = $scope.isCompleted = $scope.isPublished = null;
                viewService.updateProjects();
                final();
                return data;
            }

            function fail(data) {
                if (data.status === 401) {
                    $scope.statusText = s401;
                } else if (data.status === 500) {
                    $scope.statusText = s500;
                } else {
                    $scope.statusText = sOther;
                }
                $scope.statusClassName = "label label-danger";
                final();
                return data;
            }

            function final() {
                $scope.isQueriing = false;
                $scope.canDelete = false;
                $timeout(function () {
                    $scope.statusText = "";
                    $scope.statusClassName = "";
                }, 3000);
            }
        }
    }
})();
